const StockPreview = ({ stock }) => {
    const { imgURL, name, type, quantity, supplier, note} = stock;

    return (
        <div>
            {stock ? <div>
                        <img src={imgURL} alt={name} width={'50px'} />
                        <p>{name}</p>
                        <p>{type}</p>
                        <p>{quantity}</p>
                        <p>{supplier}</p>
                        <p>{note}</p>
                     </div> : null}
        </div>
    );
}

export default StockPreview;
